// --------------------------------------
// 來源1：OpenAI 文字
// 來源2：Enable / Disable IM SINR Map 圖片 (binary)
// --------------------------------------

// 儲存圖片 binary
let imageBinary = null;

/* ---------- 先試 Enable ---------- */
try {
  const enableBundle = $('IM SINR Map').first().json;   // 靜態名字 OK
  if (enableBundle?.binary?.data) {
    imageBinary = enableBundle.binary;
  }
} catch (_) { /* 這個節點沒跑，忽略 */ }

/* ---------- 再試 Disable ---------- */
if (!imageBinary) {
  try {
    const disableBundle = $('IM SINR Map').first().json;
    if (disableBundle?.binary?.data) {
      imageBinary = disableBundle.binary;
    }
  } catch (_) { /* 同上 */ }
}

/* ---------- 組裝輸出 ---------- */
const chainOutput = [];

if (imageBinary) {
  chainOutput.push({
    type: "image",
    content: {
      data: imageBinary.data,
      mimeType: imageBinary.mimeType,
      fileName: imageBinary.fileName
    }
  });
}

return [{ chain: chainOutput }];
